package main

import (
    "fmt"
)

func CocktailShakerSort(arr []int) []int {
    left := 0
    right := len(arr) - 1

    for left < right {
        for i := left; i < right; i++ {
            if arr[i] > arr[i+1] {
                arr[i], arr[i+1] = arr[i+1], arr[i]
            }
        }
        right--

        for i := right; i > left; i-- {
            if arr[i] < arr[i-1] {
                arr[i], arr[i-1] = arr[i-1], arr[i]
            }
        }
        left++
    }

    return arr
}

